INSERT INTO `Questions` (`Order`, `QuestionID`, `Description`, `Stem`, `Default_freq`, `Anchor_0`, `Anchor_1`, `Anchor_2`, `Anchor_3`, `Anchor_4`) VALUES
(20, 'VAS_1', 'VAS_Irritability', 'your current level of anger or irritability', 1, 'Not at all irritable', 'Extremely irritable', '', '', ''),
(19, 'VAS_0', 'VAS_Bipolar Mood', 'your current mood', 1, 'Worst ever', 'Best ever', '', '', ''),
(17, 'OTHER_0', 'OTHER_Admitted to Hospital', 'Have you been admitted to a hospital', 0, 'No', 'Yes', '', '', ''),
(18, 'OTHER_1', 'OTHER_ER Visit', 'Have you visited the Emergency Room', 0, 'No', 'Yes', '', '', ''),
(15, 'ASRM_3', 'ASRM_Talkativeness', '', 1, 'I do not talk more than usual.', 'I occasionally talk more than usual.', 'I often talk more than usual.', 'I frequently talk more than usual.', 'I talk constantly and cannot be interrupted.'),
(16, 'ASRM_4', 'ASRM_Activity', '', 1, 'I have not been more active (either socially, sexually, at work, home or school) than usual.', 'I have occasionally been more active than usual.', 'I have often been more active than usual.', 'I have frequently been more active than usual.', 'I am constantly active or on the go all the time.'),
(13, 'ASRM_1', 'ASRM_Self-confidence', '', 1, 'I do not feel more self-confident than usual.', 'I occasionally feel more self-confident than usual.', 'I often feel more self-confident than usual.', 'I feel more self-confident than usual.', 'I feel extremely self-confident all of the time.'),
(14, 'ASRM_2', 'ASRM_Needing sleep', '', 1, 'I do not need less sleep than usual.', 'I occasionally need less sleep than usual.', 'I often need less sleep than usual.', 'I frequently need less sleep than usual.', 'I can go all day and night without any sleep and still not feel tired.'),
(12, 'ASRM_0', 'ASRM_Happiness', '', 1, 'I do not feel happier or more cheerful than usual.', 'I occasionally feel happier or more cheerful than usual.', 'I often feel happier or more cheerful than usual.', 'I feel happier or more cheerful than usual most of the time.', 'I feel happier or more cheerful than usual all of the time.'),
(9, 'QIDS_9', 'QIDS_Energy level', 'How energetic have you been feeling?', 1, 'There was no change in my usual level of energy.', 'I got tired more easily than usual.', 'I had to make a big effort to start or finish my usual daily activities (for example, shopping, homework, cooking, or going to work).', 'I really couldn\\''t carry out most of my usual daily activities because I just didn\\''t have the energy.', ''),
(8, 'QIDS_8', 'QIDS_General interest', 'How has your general level of interest been?', 1, 'There was no change from usual in how interested I am in other people or activities.', 'I noticed that I was less interested in other people or activities.', 'I found I had interest in only 1 or 2 of the activities I used to do', 'I had virtually no interest in the activities I used to do.', ''),
(7, 'QIDS_7', 'QIDS_Thoughts of death or suicide', 'How much have you been thinking about suicide or death?', 0, 'I didn\\''t think of suicide or death.', 'I felt that life was empty or wondered if it was worth living.', 'I thought of suicide or death several times a week for several minutes.', 'I thought of suicide or death several times a day in some detail, or I made specific plans for suicide or actually tried to take my life.', ''),
(6, 'QIDS_6', 'QIDS_Perception of myself', 'How have you been feeling about yourself?', 1, 'I saw myself as equally worthwhile and deserving as other people.', 'I put the blame on myself more than usual.', 'For the most part, I believed that I caused problems for others.', 'I thought almost constantly about major and minor defects in myself.', ''),
(5, 'QIDS_5', 'QIDS_Concentration/decision making', 'Have you had difficulty with concentration or decision-making?', 1, 'There was no change in my usual capacity to concentrate or make decisions.', 'I occasionally felt indecisive or found that my attention wandered.', 'Most of the time, I found it hard to focus or make decisions.', 'I couldn\\''t concentrate well enough to read or I couldn\\''t make even minor decisions.', ''),
(4, 'QIDS_4', 'QIDS_Increased weight', 'Has your weight increased?', 0, 'My weight has not changed.', 'I feel as if I\\''ve had a slight weight gain.', 'I have gained 2 pounds or more.', 'I have gained 5 pounds or more.', ''),
(3, 'QIDS_3', 'QIDS_Decreased weight', 'Has your weight decreased?', 0, 'My weight has not changed.', 'I feel as if I\\''ve  had a slight weight loss.', 'I have lost 2 pounds or more.', 'I have lost 5 pounds or more.', ''),
(2, 'QIDS_2', 'QIDS_Increased appetite', 'Has your appetite increased?', 0, 'There was no change from my usual appetite.', 'I felt a need to eat more frequently than usual.', 'I regularly ate more often and/or greater amounts of food.', 'I felt driven to overeat both at mealtime and between meals.', ''),
(1, 'QIDS_1', 'QIDS_Decreased appetite', 'Has your appetite decreased?', 0, 'There was no change in my usual appetite.', 'I ate somewhat less often or lesser amounts of food than usual.', 'I ate much less than usual and only with personal effort.', 'I rarely ate within a 24-hour period, and only with really forcing myself to eat or when others persuaded me to eat.', ''),
(0, 'QIDS_0', 'QIDS_Feeling sad', 'Have you been feeling sad?', 1, 'I didn\\''t feel sad.', 'I felt sad less than half the time.', 'I felt sad more than half the time.', 'I felt sad nearly all of the time.', ''),
(22, 'VAS_3', 'VAS_Worries', 'your current level of worriedness or fearfulness', 1, 'Not fearful / worried at all', 'Extremely fearful / worried', '', '', ''),
(23, 'VAS_4', 'VAS_Hours Slept Last Night', 'how much you slept in the past 24 hours', 1, '0 hours', '24 hours', '', '', ''),
(24, 'VAS_5', 'VAS_Avoidance of Abandonment', 'how frantic you are to avoid being lonely', 0, 'Not at all frantic', 'Extremely frantic', '', '', ''),
(25, 'VAS_6', 'VAS_Stability of IP relationships', 'the state of relationships in your life', 0, 'Completely calm or stable', 'Completely unsettled', '', '', ''),
(26, 'VAS_7', 'VAS_Rx Adherence', 'how much you have been taking your prescribed medications and treatments', 0, '0%', '100%', '', '', ''),
(21, 'VAS_2', 'VAS_Hours of Daylight', 'the length of time from dawn to dusk', 0, 'Shortest day of year', 'Longest day of year', '', '', ''),
(10, 'QIDS_10', 'QIDS_Feeling sluggish', 'How sluggish have you been feeling?', 1, 'I thought, spoke, and moved at my usual pace.', 'I found that my thinking was more sluggish than usual or my voice sounded dull or flat.', 'It took me several seconds to respond to most questions and I was sure my thinking was more sluggish than usual.', 'I was often unable to respond to questions without forcing myself.', ''),
(11, 'QIDS_11', 'QIDS_Feeling restless', 'How restless have you been feeling?', 1, 'I didn\\''t feel restless.', 'I was often fidgety, wringing my hands, or need to change my sitting position.', 'I had sudden impulses to move about and was quite restless. been increased compared to how it normally is.', 'At times, I was unable to stay seated and needed to pace around.', ''),
(27, 'VAS_8', 'VAS_Quality of Sleep', 'the quality of your sleep last night', 1, 'Worst ever', 'Best ever', '', '', '');
